const { createTheme } = require("@mui/system");

export const Colors = {
    primary: "#faf4e9",
    secondary: "#5a5d9b",

    dark: "#22414d",
    light: "#7A79B3",

    border: "#DDDFE1",

    shaft: "#333",
    dove_gray: "#d5d5d5",
    body_bg: "#9093C4",

};

export const overrides = {
    palette: {
        primary: {
            main: Colors.primary
        },
        secondary: {
            main: Colors.secondary
        },
    },
    components: {
        MuiButton: {
            background: "#fff"            
        }
    }
};

export const theme = createTheme({
    ...overrides
})
